// import logo from 'https://i.ibb.co/s9Qys2j/logo.png';
import classes from './Navpar.module.css'
function Navpar () {
    return (
        <>
            <div className='container'>
                <nav className={classes.nav}>
                    
                        <img src='https://i.ibb.co/s9Qys2j/logo.png'></img>
                        <ul>
                            <li>Home</li>
                            <li>About</li>
                            <li>Vidios</li>
                        </ul>
                
                </nav> 
            </div>
        </>
    )
}
export default Navpar
